INSERT INTO `articles` (`id`, `speciality_id`, `title`, `description`, `image`, `status`) VALUES
(2, 1, 'Accessing the Pulp Chamber', 'A small opening is made in the crown of the tooth to access the pulp chamber and root canals. Using specialized instruments, the dentist will carefully remove the diseased pulp tissue.', '1716460507.jpg', 1),
(3, 1, 'Root Canal Treatment', 'Root canal treatment is a multi-step procedure performed by a dentist or an endodontist (a specialist in dental pulp diseases). The main goal of the treatment is to remove the infected or inflamed pulp tissue, disinfect the interior of the tooth, and seal it to prevent future infections. Here are the basic steps involved in the procedure:', '1716461786.png', 1),
(4, 1, 'Cleaning and Shaping', 'Once the pulp is removed, the dentist cleans and shapes the root canals using tiny files. This step ensures that all infected tissue is eliminated and the canals are prepared for filling.', '1716460747.jpg', 1),
(5, 1, 'Fifth Article', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum', '1678101626.png', 1),
