(18, 8, 'CROWN', 'A crown is an artificial restoration that fits over the remaining part of a prepared tooth, making it strong and giving it the shape of a natural tooth. A crown is sometimes known as a \'cap\' Crowns are an ideal way to repair teeth that have been broken, or have been weakened by tooth decay or a very large filling. In root-filled teeth it may be necessary to insert a post into the tooth root before placing a crown. A post gives support and helps the crown to stay in place. The surface of the tooth may be removed down to the level of the gum. A crown is used for:\r\n\r\n a discoloured filling and would like to improve the appearance of the tooth.\r\n a root filling and need a crown to protect what is left of the tooth.\r\nIt may help to hold a bridge or denture firmly in place.\r\n\r\nCrowns can be made of a variety of different materials :\r\n\r\nPorcelain bonded to precious metal\r\nPorcelain\r\nAll-ceramic\r\nGlass\r\n\r\n\r\nGold-alloy crowns', '1716371184.jpg', 1),
