(24, 17, 'Dummy', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', '1684157965.png', 1),
(25, 5, 'DENTAL IMPLANT', NULL, '1716369158.jpg', 1),
(26, 7, 'PARITAL DENTURE', 'This is a plate with one or more false teeth on it. It may be all plastic or a mixture of metal and plastic. Both types may have clips (clasps) to help keep the denture in place in your mouth.', '1716368999.jpg', 1),
(27, 7, 'COMPLETE  DENTURE:', 'A complete denture is a removable dental prosthesis that replaces all of the natural dentition and associated structures of the upper jaw or lower jaw.', '1716369246.jpg', 1),
(28, 7, '1. BRIDGE', 'A dental bridge is made by putting crowns on the teeth at either side of the gap, and then joining these two crowns together by placing a false tooth in the space. This is all made in the laboratory and then the pieces are cemented into place with special adhesives. The bridge can\'t be removed. You can have a bridge only if you have enough strong teeth with good bone support. Bridges are usually made of porcelain bonded to precious metal. Sometimes other non-precious metals are used in the base for strength. There are also new bridges made entirely of a special type of strong porcelain.\r\n\r\nYou need to clean your bridge every day, to prevent problems such as bad breath and gum disease. You also have to clean under the false tooth every day.', '1716369332.jpg', 1),
(29, 3, 'BRACES:', 'Dental braces are devices used in orthodontics that align and straighten teeth and help position them with regard to a person\'s bite, while also aiming to improve dental health.They are small brackets stuck at specific positions  on the tooth and a metal wire is passed through their slots. Braces also fix gaps. They are often used to correct underbites, as well as malocclusions, overbites, open bites, deep bites, cross bites, crooked teeth, and various other flaws of the teeth and jaw. Braces can be either cosmetic or structural. Dental braces are often used in conjunction with other orthodontic appliances to help widen the palate or jaws and to otherwise assist in shaping the teeth and jaws.\r\n\r\nLingual braces are also available for people who have esthetic concerns.', '1716369521.jpg', 1),
(30, 3, 'INVISIBLE BRACES OR INVASILIGN:', 'Clear aligners, also known as clear-aligner treatment, are orthodontic devices that are a transparent, plastic form of dental braces used to adjust teeth. They are indicated for \"mild to moderate crowding (16 mm) and mild to moderate spacing (16 mm)\", in cases where there are no discrepancies of the jawbone. They are also indicated for patients who have experienced a relapse after fixed orthodontic treatment.', '1716369574.jpg', 1),
(31, 3, 'SPACE MAINTAINERS:', 'A space maintainer is an appliance that is custom-made by a dentist or orthodontist in acrylic or metal material. It can be either removable or cemented in a child\'s mouth. Its purpose is to keep the space open to allow the permanent tooth to erupt and come into place.', '1716369621.jpg', 1),
(32, 3, 'DENTAL SEALANTS:', 'Dental sealants (also termed pit and fissure sealants) are a dental treatment intended to prevent tooth decay. Teeth have recesses on their biting surfaces; the back teeth have fissures (grooves) and some front teeth have cingulum pits. It is these pits and fissures which are most vulnerable to tooth decay because food and bacteria stick in them and because they are hard-to-clean areas. Dental sealants are materials placed in these pits and fissures to fill them in, creating a smooth surface which is easy to clean. Dental sealants are mainly used in children who are at higher risk of tooth decay, and are usually placed as soon as the adult molar teeth come through.', '1716369675.jpg', 1),
(33, 3, 'FLOURIDE TREATMENT:', 'Fluoride varnish is a highly concentrated form of fluoride which is applied to the tooth\'s surface, by a dentist, dental hygienist or other health care professional, as a type of topical fluoride therapy. It is not a permanent varnish but due to its adherent nature it is able to stay in contact with the tooth surface for several hours. It may be applied to the enamel, dentine or cementum of the tooth and can be used to help prevent decay, remineralise the tooth surface and to treat dentine hypersensitivity.', '1716369732.jpg', 1),
(34, 2, 'TOOTH WHITENING:', 'Tooth whitening can be a very effective way of lightening the natural colour of your teeth without removing any of the tooth surfaces.\r\n\r\nOur teeth become more discolored as we get older. Our teeth can be stained on the surface by food and drinks such as tea, coffee, red wine and blackcurrant. Smoking can also stain teeth. Calculus\' or tartar can also affect the colour of your teeth. Some people may have staining under the surface, which can be caused by certain antibiotics or by tiny cracks in the teeth which take up stains.\r\n\r\n Professional bleaching is the most usual method of tooth whitening. The total treatment can usually be done within three to four weeks time.\r\n\r\nThere is now laser whitening or power whitening\' .The light speeds up the reaction of the whitening product and the colour change can be achieved more quickly. Laser whitening is said to make teeth up to five or six shades lighter.', '1716370240.jpg', 1),
(35, 2, 'FILLINGS AND RESTORATIONS:', 'A restoration, or filling, is the replacement of tooth structure that is damaged due to decay or fracture.\r\n\r\nThere are a number of different fillings, including:\r\nAmalgam (silver coloured).\r\nComposite fillings (tooth coloured).\r\nGold inlays and onlays (gold coloured).\r\nPorcelain inlays (tooth coloured).', '1716370305.jpg', 1),
(36, 2, 'NON TOOTH COLOURED FILLING', '1. AMALGAM:\r\n\r\nAmalgam fillings are silver coloured. They are made by combining mercury and a silver alloy (50% mercury, 35% silver, and 15% tin, copper and other metals). Amalgam is long lasting and hard wearing and has been used in fillings for at least 150 years. It is economical to use and it is not unusual for an amalgam filling to last 15 to 20 years.\r\n\r\nThis kind of filling is usually used on the back \'chewing\' teeth. Before the filling can be placed, the dentist must prepare the area by removing all the decay and shaping the cavity to hold the filling in place. If the tooth is badly broken, a small stainless steel pin is used to help secure the filling.', '1716370357.jpg', 1),
(37, 8, '1. COMPOSITE', 'White fillings are made of composite resin material and are placed in the dental surgery in one visit. They are a good choice for replacing small amounts of dental decay as they preserve your natural tooth structure and rebuild your tooth conservatively. After the tooth is prepared, the filling is bonded onto the area and a light shone onto it to set it. The dentist will choose a shade to match your own teeth.', '1716370723.jpg', 1),
(38, 8, 'INLAYS AND ONLAYS:', 'if you have larger amounts of decay, or cracks on teeth due to old amalgam fillings or general wear, a laboratory-crafted restoration called inlays or onlays are recommended, which give the tooth a natural look while supporting the remaining enamel. They are bonded to your enamel resulting in strengthening of your enamel. They may be tooth coloured (PORCELAIN) or non tooth colored (GOLD/METAL) inlays onlays', '1716370766.jpg', 1),
(39, 8, 'CROWN:', 'A crown is an artificial restoration that fits over the remaining part of a prepared tooth, making it strong and giving it the shape of a natural tooth. A crown is sometimes known as a \'cap\' Crowns are an ideal way to repair teeth that have been broken, or have been weakened by tooth decay or a very large filling. In root-filled teeth it may be necessary to insert a post into the tooth root before placing a crown. A post gives support and helps the crown to stay in place. The surface of the tooth may be removed down to the level of the gum. A crown is used for:\r\n\r\n a discoloured filling and would like to improve the appearance of the tooth.\r\n a root filling and need a crown to protect what is left of the tooth.\r\nIt may help to hold a bridge or denture firmly in place.\r\n\r\nCrowns can be made of a variety of different materials :\r\nPorcelain bonded to precious metal\r\nPorcelain\r\nAll-ceramic\r\nGlass\r\n\r\n\r\nGold-alloy crowns', '1716370924.jpg', 1),
(40, 8, 'VENEER:', 'A veneer is a thin layer of porcelain made to fit over the front surface of a tooth and can improve the colour, shape and position of your teeth.', '1716370970.jpg', 1),
(41, 10, 'Dental Caries (Cavities)', 'Dental caries are prevalent among Pakistani children due to high sugar consumption and inadequate oral hygiene practices. Pediatric dentists play a key role in preventing and treating cavities through regular check-ups, fluoride treatments, and dental sealants.', '1716373446.jpg', 1),
(42, 10, 'Malocclusion', 'Malocclusion, or misalignment of teeth, is another common issue. Early detection and intervention by a pediatric dentist can guide proper teeth alignment, often reducing the need for more extensive orthodontic treatment later.', '1716373566.jpg', 1),
(43, 10, 'Dental Trauma', 'Children are prone to dental injuries from falls and accidents. Pediatric dentists are skilled in managing dental trauma, ensuring that injured teeth are treated promptly and effectively.', '1716373653.jpg', 1),
(44, 10, 'Sedation Dentistry', 'For more anxious or special needs children, sedation dentistry can be an option. Pediatric dentists are trained to safely administer sedation, ensuring a stress-free experience for the child.', '1716373790.jpg', 1);
