INSERT INTO `specialities` (`id`, `speciality`, `description`, `image`) VALUES
(1, 'ROOT CANAL TREATMENT', 'A root canal is a treatment used to repair and save a tooth that is badly decayed or becomes infected. During a root canal procedure, the nerve and pulp are removed and the inside of the tooth is cleaned and sealed. Without treatment, the tissue surrounding the tooth will become infected and abscesses may form.\r\n\r\nAn access hole will then be drilled into the tooth. The pulp along with bacteria, the decayed nerve tissue and related debris is removed from the tooth. The cleaning out process is accomplished using root canal files. A series of these files of increasing diameter are each subsequently placed into the access hole and worked down the full length of the tooth to scrape and scrub the sides of the root canals.Once the tooth is thoroughly cleaned, it is sealed. ', '167865268.png'),
(2, 'TOOTH CLEANING', 'With the small mirror to guide them, the dental hygienist uses a Scaler to get rid of plaque and tartar around your gum line, as well as in between your teeth. You\'ll hear scraping, but this is normal. Teeth cleaning is part of oral hygiene and involves the removal of dental plaque from teeth with the intention of preventing cavities, gingivitis, and periodontal disease', '1685963344.png'),
(3, 'ORTHODONTICS', 'Orthodontia, also called orthodontics and dentofacial orthopedics, is a specialty of dentistry that deals with the diagnosis, prevention and correction of malpositioned teeth and jaws. Three type of appliances can be used :\r\n\r\nREMOVABLE APPLIANCES\r\nFIXED APPLIANCES\r\nFUNCTIONAL APPLIANCES\r\n\r\nOrthodontic treatment can focus on dental displacement only, or deal with the control and modification of facial growth. In the latter case it is better defined as \"dentofacial orthopedics\". In severe malocclusions that can be a part of craniofacial abnormality, management often requires a combination of orthodontics with headgear or reverse pull facemask and / or jaw surgery or even orthognathic surgery.', '1685963345.png'),
(5, 'DENTAL IMPLANT', 'A dental implant is used to support one or more false teeth. It is a titanium screw that can replace the root of a tooth when it fails. Just like a tooth root, it is placed into the jawbone to support a dental prosthesis such as a crown, bridge, denture, facial prosthesis or to act as an orthodontic anchor.', '1685963346.png'),
(6, 'DENTAL SURGERIES', 'Dental surgeries encompass a range of procedures performed to treat various conditions and diseases affecting the teeth, gums, and jawbones. These surgeries can include tooth extractions, root canals, dental implants, and corrective jaw surgeries. Tooth extractions are often necessary for impacted wisdom teeth or severely damaged teeth. Root canals treat infected tooth pulp, saving the natural tooth. Dental implants replace missing teeth with artificial ones anchored in the jawbone. Corrective jaw surgeries address misalignments and structural issues to improve function and aesthetics.', '1685963349.png'),
(7, 'DENTURES', 'There are three main ways to replace missing teeth.\r\nThe first is with a removable false tooth (or teeth) - called a partial denture.\r\nThe second is with a fixed bridge. A bridge is usually used when there are fewer teeth to replace, or when the missing teeth are only on one side of the mouth.\r\nThe third way is by the use of dental implants\'. This is where an artificial root is placed into the bone of the jaw and a crown or bridge placed on top of this', '1685963347.png'),
(10, 'Pediatric Dentistry Services', 'we understand the importance of early dental care and the unique needs of our youngest patients. Our dedicated pediatric dentists specialize in providing comprehensive dental care for children of all ages, from infants to adolescents, in a gentle, compassionate, and child-friendly environment.', 'padiatric service.png');
