(14, 'ORTHODONTICS', 'https://www.youtube.com/watch?v=_lAWs05F_xY&pp=ygUYb3J0aG9kb250aWNzIGRlbnRhbCBjYXJl', 'Orthodontia, also called orthodontics and dentofacial orthopedics, is a specialty of dentistry that deals with the diagnosis, prevention and correction of malpositioned teeth and jaws. Three type of appliances can be used : REMOVABLE APPLIANCES FIXED APPLIANCES FUNCTIONAL APPLIANCES Orthodontic treatment can focus on dental displacement only, or deal with the control and modification of facial growth. In the latter case it is better defined as \"dentofacial orthopedics\". In severe malocclusions that can be a part of craniofacial abnormality, management often requires a combination of orthodontics with headgear or reverse pull facemask and / or jaw surgery or even orthognathic surgery.\r\nConsultant', '3', '0', 1),
(15, 'SPACE MAINTAINERS:', 'https://www.youtube.com/watch?v=4QG5IGEZ9zw&pp=ygUeU1BBQ0UgTUFJTlRBSU5FUlMgIGRlbnRhbCBjYXJl', 'A space maintainer is an appliance that is custom-made by a dentist or orthodontist in acrylic or metal material. It can be either removable or cemented in a child\'s mouth. Its purpose is to keep the space open to allow the permanent tooth to erupt and come into place', '3', '1', 1),
(16, 'INVISIBLE BRACES OR INVASILIGN', 'https://www.youtube.com/watch?v=bWxlaIjTzBo&pp=ygUrSU5WSVNJQkxFIEJSQUNFUyBPUiBJTlZBU0lMSUdOICBkZW50YWwgY2FyZQ%3D%3D', 'Clear aligners, also known as clear-aligner treatment, are orthodontic devices that are a transparent, plastic form of dental braces used to adjust teeth. They are indicated for \"mild to moderate crowding (16 mm) and mild to moderate spacing (16 mm)\", in cases where there are no discrepancies of the jawbone. They are also indicated for patients who have experienced a relapse after fixed orthodontic treatment', '3', '1', 1),
(17, 'TOOTH WHITENING', 'https://www.youtube.com/watch?v=IE1P9O3myWw&pp=ygUedGVldGggd2hpdGVuaW5nIGRlbnRhbCBjbGluaWMg', 'Tooth whitening can be a very effective way of lightening the natural colour of your teeth without removing any of the tooth surfaces. Our teeth become more discolored as we get older. Our teeth can be stained on the surface by food and drinks such as tea, coffee, red wine and blackcurrant. Smoking can also stain teeth. Calculus\' or tartar can also affect the colour of your teeth. Some people may have staining under the surface, which can be caused by certain antibiotics or by tiny cracks in the teeth which take up stains. Professional bleaching is the most usual method of tooth whitening. The total treatment can usually be done within three to four weeks time. There is now laser whitening or power whitening\' .The light speeds up the reaction of the whitening product and the colour change can be achieved more quickly. Laser whitening is said to make teeth up to five or six shades lighter', '2', '1', 1),
(18, 'FILLINGS AND RESTORATIONS:', 'https://www.youtube.com/watch?v=m1aat50xt-s&pp=ygUoRklMTElOR1MgQU5EIFJFU1RPUkFUSU9OUyBkZW50YWwgY2xpbmljIA%3D%3D', 'A restoration, or filling, is the replacement of tooth structure that is damaged due to decay or fracture. There are a number of different fillings, including: Amalgam (silver coloured). Composite fillings (tooth coloured). Gold inlays and onlays (gold coloured). Porcelain inlays (tooth coloured)', '2', '1', 1),
(19, 'DENTAL IMPLANT', 'https://www.youtube.com/watch?v=DZ2lDxO4LCc&pp=ygUdREVOVEFMIElNUExBTlQgZGVudGFsIGNsaW5pYyA%3D', 'A dental implant is used to support one or more false teeth. It is a titanium screw that can replace the root of a tooth when it fails. Just like a tooth root, it is placed into the jawbone to support a dental prosthesis such as a crown, bridge, denture, facial prosthesis or to act as an orthodontic anchor.', '1', '1', 1),
(20, 'PARITAL DENTURE', 'https://www.youtube.com/watch?v=S5CCX9ntf70&pp=ygUeUEFSSVRBTCBERU5UVVJFIGRlbnRhbCBjbGluaWMg', 'This is a plate with one or more false teeth on it. It may be all plastic or a mixture of metal and plastic. Both types may have clips (clasps) to help keep the denture in place in your mouth', '1', '1', 1),
(21, 'BRIDGE', 'https://www.youtube.com/watch?v=bndhboGzIUs&pp=ygUWQlJJREdFOiBkZW50YWwgY2xpbmljIA%3D%3D', 'A dental bridge is made by putting crowns on the teeth at either side of the gap, and then joining these two crowns together by placing a false tooth in the space. This is all made in the laboratory and then the pieces are cemented into place with special adhesives. The bridge can\'t be removed. You can have a bridge only if you have enough strong teeth with good bone support. Bridges are usually made of porcelain bonded to precious metal. Sometimes other non-precious metals are used in the base for strength. There are also new bridges made entirely of a special type of strong porcelain. You need to clean your bridge every day, to prevent problems such as bad breath and gum disease. You also have to clean under the false tooth every da', '1', '1', 1);
